import './App.css';
import './assets/fonts/fonts.css';
import Navbar from './components/Navbar';
import HomePage from './components/HomePage';
import Footer from './components/Footer';
import { Router } from 'react-router-dom';


function App() {
  return (
    <Router>
    <div className="App">
        <Navbar />
        <HomePage />
        <Footer />
    </div>
    </Router>
  );
}

export default App;
